import {Button} from 'react-bootstrap';
import './LoginForm.css';
import Auth from '../components/kakaologins/Auth';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

const LoginForm =()=>{
    const REST_API_KEY = "[본인 REST API KEY 값]";
    const REDIRECT_URI = "http://localhost:3000/main";
    const KAKAO_AUTH_URL = `https://kauth.kakao.com/oauth/authorize?client_id=${REST_API_KEY}&redirect_uri=${REDIRECT_URI}&response_type=code`;

    return(
        <div className='buttonGroup'>
            <Button className='loginbutton' type="submit"
                style={{margin: "5px", borderColor: "#515151" ,backgroundColor: "#515151"}}>
                SignUp
            </Button>
            <Switch>
                <Button className='loginbutton' type="submit" href={KAKAO_AUTH_URL}
                    style={{borderColor: "#353535", backgroundColor: "#353535"}}>
                    Login
                </Button>
                <Route path="/main">
                    <Auth/>
                </Route>
            </Switch>
        </div>
    )
}

export default LoginForm;
